import React from 'react';

function Nav() {
    return (
        <div id="Nav">
            <a href="#FAQ">FAQ</a>
            <a href="#Gallery">Gallery</a>
            <a href="#Download">Download</a>
            <a href="#contact">Contact</a>
        </div>
    );
}

export default Nav;
